import React from 'react'
import Topbar from './Topbar';
import { Container , Row , Col } from 'react-bootstrap';

const Home = props => {

    return (
        <div>
            <Topbar />
            <div>
            <Container>
                <Row>
                    <Col></Col>
                    <Col>   <span>&nbsp;&nbsp;</span>
                            <h1>Numerical Site</h1><p></p>
                            <h1>Presents</h1>
                    </Col>
                    <Col></Col>
                </Row>
            </Container>
            </div>
        </div>
    )
}

export default Home;
